import logo from './logo.svg';
import './App.css';
import Card from './components/Card';
import { useState } from 'react';

function App() {
  const [cards, setCards] = useState(
  <Card name="Ant"/>,
  <Card name="Bat"/>,
  <Card name="Cat"/>,
  <Card name="Dog"/>,
  <Card name="Elephant"/>,
  <Card name="Frog"/>,
  <Card name="Goat"/>
  );
  return (
    <div className="App">
      <Card name="Ant"/>
      <Card name="Bat"/>
      <Card name="Cat"/>
      <Card name="Dog"/>
      <Card name="Elephant"/>
      <Card name="Frog"/>
      <Card name="Goat"/>
    </div>
  );
}

export default App;
